export const sucursales = () => {
  return [
    {
      id: 1,
      address: 'Lavalle 2217',
      name: 'Sucursal nro 1'
    },
    {
      id: 2,
      address: 'Tribulato 2450',
      name: 'Sucursal nro 2'
    },
    {
      id: 3,
      address: 'San Martin 3210',
      name: 'Sucursal nro 3'
    },
  ]
}

export const profesionales = () => {
