    {
      id: 2,
      name: 'Julieta',
    },
    {
      id: 3,
      name: 'Mariana',
    },
  ]
}

export const horarios = () => {
  return [
    {
      id: 1,
      hour: '10.00hs a 11.00hs',
    },
    {
      id: 2,
      hour: '12.00hs a 13.00hs',
    },
    {
      id: 3,
      hour: '16.00hs a 17.00hs',
    },
  ]
}
